    E --> I[Plus de 15 types disponibles !]`},graph:{title:"Crer un diagramme de flux (Flowchart)",description:"Les diagrammes de flux (ou flowcharts) te permettent de visualiser des processus, des dcisions et des flux de travail. Ils sont parfaits pour reprsenter des algorithmes, des workflows mtier, ou toute logique de dcision. Tu peux orienter ton diagramme dans 4 directions diffrentes : de haut en bas (TD), de bas en haut (BT), de gauche  droite (LR), ou de droite  gauche (RL). Chaque nud peut avoir une forme spcifique selon sa fonction dans le processus. Voici une explication dtaille de chaque lment de syntaxe :",syntax:[{label:"Nud rectangulaire",description:"Utilis pour reprsenter une tape standard ou une action dans le processus. C'est la forme par dfaut si aucune autre n'est spcifie.",code:"A[Texte du nud] B[Un autre nud avec du texte long]"},{label:"Nud de dcision (losange)",description:"Utilis pour reprsenter une dcision ou une condition. Gnralement, ce nud a deux ou plusieurs sorties, chacune correspondant  une rponse possible  la question pose.",code:"C{Question ou condition?} D{Est-ce valide?}"},{label:"Nud arrondi",description:"Utilis pour reprsenter un processus ou une action spcifique. La forme arrondie permet de le distinguer des nuds rectangulaires standards.",code:"E(Processus ou action) F(tape intermdiaire)"},{label:"Nud circulaire",description:"Utilis pour reprsenter le dbut ou la fin d'un processus. Peut aussi tre utilis pour mettre en avant un point important ou un vnement cl.",code:"G((Dbut)) H((Fin)) I((Point important))"},{label:"Nud asymtrique",description:"Utilis pour reprsenter une action ou une tape spciale qui sort du cadre standard. La forme asymtrique attire l'attention sur ce nud.",code:"J>Action spciale] K>Sortie]"},{label:"Nud hexagonal",description:"Utilis pour reprsenter une tape de prparation ou de configuration. La forme hexagonale est souvent utilise pour des tapes techniques ou de paramtrage.",code:"L{{Prparation}} M{{Configuration}}"},{label:"Connexion simple",description:"Utilise pour relier deux nuds. La flche pleine indique une relation directe ou un flux standard entre les nuds. La ligne sans flche est rarement utilise, mais peut reprsenter une relation passive ou une dpendance.",code:"A --> B (flche pleine) A --- B (ligne sans flche)"},{label:"Connexion avec texte",description:"Utilise pour relier deux nuds tout en prcisant la nature de la relation ou la condition. Le texte est affich le long de la flche.",code:"A -->|Oui| B A -->|Si vrai| C A --|Label| D"},{label:"Connexion pointille",description:"Utilise pour reprsenter une relation optionnelle, conditionnelle ou moins importante. Peut aussi indiquer une alternative ou un scnario secondaire.",code:"A -.-> B A -.->|Optionnel| C"},{label:"Connexion paisse",description:"Utilise pour reprsenter une relation forte ou importante. La flche paisse attire l'attention sur cette connexion.",code:"A ==> B A ==>|Important| C"},{label:"Chanage",description:"Permet de relier plusieurs nuds en squence. Chaque nud est connect au suivant, formant une chane de processus ou d'tapes.",code:"A --> B --> C --> D (plusieurs connexions)"},{label:"Sous-graphes",description:"Permet de regrouper plusieurs nuds dans un sous-graphe, souvent utilis pour reprsenter un sous-processus ou une section spcifique du diagramme. Le titre du sous-graphe est affich en haut du groupe.",code:"subgraph titre A --> B end"},{label:"Styles personnaliss",description:"Permet de personnaliser l'apparence des nuds en dfinissant des styles spcifiques. 'fill' dfinit la couleur de remplissage, 'stroke' dfinit la couleur de la bordure. 'classDef' permet de dfinir une classe de style rutilisable pour plusieurs nuds.",code:"style A fill:#f9f,stroke:#333 classDef className fill:#ff0"}],example:`graph TD
